import React from 'react';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Button from 'react-bootstrap/Button';

function Product() {
    const [searchOpen, setSearchOpen]= useState
  return (
    <div style={{ position: 'relative' }}>
      <Navbar />
      <div style={{position:"absolute", top:0, left:"60%"}}>
        {' '}
        <Button
          variant="success"
          className="bg-success"
          style={{ height: '35px' }}
        >
          <SearchOutlinedIcon className="text-white" />
        </Button>
      </div>
      <div className='d-none'>
        <div
          className="my- m-auto d-none d-md-block"
          style={{ width: '30%', position: 'absolute', top: 0, left: '30%' }}
        >
          <SearchBar />
        </div>
        <div
          className="d-flex bg-success  d-md-none"
          style={{
            width: '80%',
            height: '35px',
            position: 'absolute',
            top: 0,
            left: 0,
          }}
        >
          <SearchBar />
          <Button
            variant="success"
            className="bg-success"
            style={{ height: '35px' }}
          >
            <SearchOutlinedIcon className="text-white" />
          </Button>
        </div>
        <div></div>
      </div>
    </div>
  );
}

export default Product;
